script: |
  super -f text -I q10098.spq | sort > q10098.out

inputs:
  - name: q10098.spq
    data: |
      SELECT DISTINCT col2, + 66 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT ( NOT - 68 < + - ( - - col2 ) * - col1 + 62 );
  - name: tab1

outputs:
  - name: q10098.out
    data: |
      59	66
      68	66
      96	66
